С мониторингом системы Траектория в режиме реального времени  вы сможете:
- наблюдать за передвижением и местоположением объектов на карте;
- отслеживать  любые изменения скорости движения, температуры, уровня топлива т.д.;
- дистанционно управлять объектами и водителями ( заставить выполнить команду,  остановиться в случае  превышения скорости и т.д);
- получать уведомлений об активности объекта на любой гаджет;
- отслеживать движения объекта по установленному маршруту;
- запрашивать отчетность в любом удобном формате  (таблицы, графики) и многое другое.

